var sortby=0;
function dosort() { 
	if (sortby < 5) {
		all[n].sort(function(a,b) {
		   if (sortby==0) return b.u-a.u;
		   if (sortby==1) return b.x-a.x;
		   if (sortby==2) return b.g-a.g;
		   if (sortby==3) return b.f-a.f;
		   return a.p-b.p;
			});
	}
	 else {
		var p = sortby-4;
		all[n].sort(function(a,b) {
			return b.y[p-1]-a.y[p-1];
		});
	}

}
var n=2;
var which=-1;

dosort();

next();

function changesort(e) {
	sortby = e.selectedIndex;
	dosort();
	which=0;
	plot(which);
}
function changen(e) {
	n = e.selectedIndex+2;
	dosort();
	which=0;
	plot(which);
}
function plot(which) {
	var x = [];
	for (var i=1; i<171; i++) x.push(i);
	var y = [];
	for (var i=0; i<all[n][which].y.length; i++) y.push(all[n][which].y[i]);
	var d = [{x: x, y: y, type: 'bar'}];
	
	var layout = {
		xaxis: {title:'Period'},
		yaxis: {title:'Increase in repeating ' + n + '-grams compared to unmodified Z340'}
	}
	
	Plotly.newPlot('myDiv', d, layout);  
	
	document.getElementById("symbols").innerHTML = symbols(all[n][which].m);
	document.getElementById("info").innerHTML = "<b>Sum:</b> " + all[n][which].u + ", <b>Max:</b> " + all[n][which].x + " <b>at period:</b> " + all[n][which].p + ".  <b>Sigma: </b>" + Math.round(all[n][which].g*1000)/1000 + ", <b>Shuffle Sigma: </b>" + Math.round(all[n][which].f*1000)/1000;
	document.getElementById("count").innerHTML = "<i>(" + (which + 1) + " of " + all[n].length + ")</i>";
	var pp = "";
	if (sortby > 4) pp = "<b>Period " + (sortby-4) + " increase:</b> " + all[n][which].y[sortby-5];
	document.getElementById("pp").innerHTML = pp;
	
}
function symbols(s) {
	var result = "";
	for (var i=0; i<s.length; i++) result += "<img src=\"http://www.oranchak.com/zodiac/webtoy/alphabet/darker/" + getName(s.charAt(i), true) + ".jpg\">";
	return result;
}
function next() {
	if (which < all[n].length-1) {
		which++;
		plot(which);
	}
}
function prev() {
	if (which > 0) {
		which--;
		plot(which);
	}
}
function nextskip() {
	if (which+20 <= all[n].length-1) {
		which+=20;
	} else which=all[n].length-1;
	plot(which);
}
function prevskip() {
	if (which-20 >= 0) {
		which-=20;
	} else which=0;
	plot(which);
}
function last() {
	which = all[n].length-1;
	plot(which);
}
function first() {
	which = 0;
	plot(which);
}
